$(document).ready(function() {

//Funcion para generar el QR
pdf = function(){


				var doc = new jsPDF('l');
				var nombre   = $("#contentName").val() ;
				var APaterno = $("#contentAMaterno").val();
				var AMaterno = $("#contentAPaterno").val();
				var email 	 = $("#contentEmail").val();
				
				doc.setFontSize(40)
				doc.setFont('helvetica')
				doc.setFontType('bold')
				doc.text(50, 25, 'Constancia del USECAD')

				doc.setFontSize(30)
				doc.setTextColor(100);
				doc.text(35, 55, 'Nombre: '+nombre+" "+APaterno+" "+AMaterno);
				//doc.setTextColor(0, 0, 255);
				doc.setTextColor(100);
				doc.text(35, 65, 'Contacto: ' +email);

				//imagen USECAD en pdf

				var imgDat = 'data:image/png;base64,'
				doc.addImage(imgDat, 'JPEG', 240, 10, 25, 25)

				// logo unam en pdf

				var imgDat = 'data:image/png;base64,'
				doc.addImage(imgDat, 'JPEG', 20, 10, 25, 25)

				var imgData = document.getElementById("YAID").src;

							//Coordenadas    x   y    Size
				doc.addImage(imgData, 'PNG', 220, 140, 50, 50, "QR", "FAST");
				doc.save('Constancia'+nombre+'.pdf');		
 };


//Botones
$("#pdf-btn").on("click", pdf);

});